import React from "react";

function MovieCard({Movie}) {
    const movie = Movie;
    return (<>
        <div className="movie">
            <div><p>{movie.year}</p></div>
            <div>
                <img
                    src={movie.Poster !== 'N/A' ? movie.Poster : 'https://via.placeholder.com/404'}
                    alt="Movie Poster"
                />
            </div>
            <div>
                <span> {movie.Type}</span>
                <h3>{movie.Title}</h3>
            </div>

        </div>
    </>);
}

export default MovieCard;
